import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import axios from 'axios';
import './Home.css';

const Home = () => {
  const [featuredListings, setFeaturedListings] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    fetchFeaturedListings();
  }, []);

  const fetchFeaturedListings = async () => {
    try {
      const response = await axios.get('http://localhost:5000/api/listings?limit=6');
      setFeaturedListings(response.data);
    } catch (error) {
      console.error('Error fetching listings:', error);
    } finally {
      setLoading(false);
    }
  };

  const categories = [
    { name: 'Property', icon: 'üè†', slug: 'property', description: 'Houses, apartments, and commercial spaces', color: '#00bfff' },
    { name: 'Vehicles', icon: 'üöó', slug: 'vehicles', description: 'Cars, bikes, and transportation', color: '#ff6b6b' },
    { name: 'Electronics', icon: 'üíª', slug: 'electronics', description: 'Gadgets, laptops, and tech devices', color: '#4ecdc4' },
    { name: 'Furniture', icon: 'ü™ë', slug: 'furniture', description: 'Home and office furniture', color: '#45b7d1' },
    { name: 'Clothing', icon: 'üëï', slug: 'clothing', description: 'Fashion and apparel rentals', color: '#f9ca24' },
  ];

  return (
    <div className="home">
      {/* Hero Section */}
      <section className="hero-section">
        <div className="container">
          <div className="hero-content">
            <h1>Welcome to RentLONA.com</h1>
            <p>Find everything you need to rent - from properties to electronics and more!</p>
            <div className="search-bar">
              <input
                type="text"
                placeholder="Search for rentals..."
                className="search-input"
              />
              <button className="search-btn">Search</button>
            </div>
          </div>
        </div>
      </section>

      {/* Categories Section */}
      <section className="categories-section">
        <div className="container">
          <div className="section-header">
            <h2>Explore Categories</h2>
            <p>Find what you're looking for from our wide range of rental categories</p>
          </div>
          <div className="categories-grid">
            {categories.map((category) => (
              <Link
                key={category.slug}
                to={`/listings?category=${category.slug}`}
                className="category-card"
                style={{ '--category-color': category.color }}
              >
                <div className="category-icon">{category.icon}</div>
                <h3>{category.name}</h3>
                <p>{category.description}</p>
                <div className="category-stats">
                  <span className="stat-count">100+</span>
                  <span className="stat-text">Listings</span>
                </div>
              </Link>
            ))}
          </div>
        </div>
      </section>

      {/* Featured Listings Section */}
      <section className="featured-section">
        <div className="container">
          <div className="section-header">
            <h2>Featured Listings</h2>
            <p>Discover our most popular rental items</p>
          </div>
          {loading ? (
            <div className="loading-spinner">
              <div className="spinner"></div>
              <p>Loading featured listings...</p>
            </div>
          ) : (
            <div className="featured-grid">
              {featuredListings.map((listing) => (
                <div key={listing._id} className="featured-card">
                  <div className="card-image">
                    {listing.images && listing.images.length > 0 ? (
                      <img src={listing.images[0].url} alt={listing.title} />
                    ) : (
                      <div className="no-image">
                        <span>No Image</span>
                      </div>
                    )}
                  </div>
                  <div className="card-content">
                    <h3 className="card-title">{listing.title}</h3>
                    <div className="card-details">
                      <span className="price">${listing.price}/day</span>
                      <span className="location">{listing.location?.city || 'Location not specified'}</span>
                    </div>
                    <Link to={`/listings/${listing._id}`} className="btn btn-primary card-btn">
                      View Details
                    </Link>
                  </div>
                </div>
              ))}
            </div>
          )}
        </div>
      </section>

      {/* Stats Section */}
      <section className="stats-section">
        <div className="container">
          <div className="stats-header">
            <h2>Trusted by Thousands</h2>
            <p>Join our growing community of renters and lenders</p>
          </div>
          <div className="stats-grid">
            <div className="stat-card">
              <div className="stat-number">1000+</div>
              <div className="stat-label">Active Listings</div>
            </div>
            <div className="stat-card">
              <div className="stat-number">500+</div>
              <div className="stat-label">Happy Users</div>
            </div>
            <div className="stat-card">
              <div className="stat-number">50+</div>
              <div className="stat-label">Categories</div>
            </div>
            <div className="stat-card">
              <div className="stat-number">24/7</div>
              <div className="stat-label">Support</div>
            </div>
          </div>
        </div>
      </section>

      {/* CTA Section */}
      <section className="cta-section">
        <div className="container">
          <div className="cta-content">
            <h2>Ready to Rent or List?</h2>
            <p>Join thousands of users who trust RentLONA.com for their rental needs.</p>
            <div className="cta-actions">
              <Link to="/register" className="btn btn-primary cta-primary">Get Started</Link>
              <Link to="/listings" className="btn btn-secondary cta-secondary">Browse Listings</Link>
            </div>
          </div>
        </div>
      </section>
    </div>
  );
};

export default Home;
